import React from 'react';
import ReactDOM from 'react-dom';

const CarouselItems = [
    {
      "imgName" : "carousel-item active",
      "imgsrc" : "/images/Ski/img1.jpg",
      "imgalt" : "sk1",
      "caption" : "Deal Of The Month"+
                  "7 nights incl.lift pass from €179",
      "href" : "#",
      "indicators" : {
                    "target" : "#ski",
                    "slideto" : "0",
                    "className" : "active"
      }
    },
    {
      "imgName" : "carousel-item",
      "imgsrc" : "/images/Ski/img1.jpg",
      "imgalt" : "sk2",
      "caption" : "jirkklsfh",
      "href" : "#",
      "indicators" : {
                    "target" : "#ski",
                    "slideto" : "1",
                    "className" : ""
      }
    },
    {
    "imgName" : "carousel-item",
    "imgsrc" : "/images/Ski/img1.jpg",
    "imgalt" : "sk3",
    "caption" : "jirkklsfh",
    "href" : "#",
    "indicators" : {
                  "target" : "#ski",
                  "slideto" : "2",
                  "className" : ""
    }
  }
]
export default CarouselItems;
